['드래곤 테이머즈M에는 테이머님이 보유한 드래곤의 종류와 특성에 따라 4가지 진형 중 하나를 선택하여 전투를 더 유리하게 진행할 수 있습니다.\n모든 진형은 각각 다른 효과를 가지고 있으며 진형 레벨업으로 진형의 효과를 강화시킬 수 있습니다.']='Anjeun tiasa milih salah sahiji 4 formasi nurutkeun naon rupa komodo anjeun boga jeung atribut maranéhna pikeun nyieun perangna leuwih nguntungkeun pikeun anjeun dina Naga Tamers M. \nUnggal formasi boga épék béda, tur anjeun tiasa ningkatkeun épék ngaliwatan Formasi Level-up.',
