['드래곤과 {1}회 작별하기']='pamitan ka Naga X {1}',
['드래곤과 몬스터들은 스킬을 통해서 아군을 강하게 하는 효과를 부여할 수 있습니다.\n\n- {@green}공격력 증가{@DEFAULT} : 공격력이 20% 증가됩니다. (최대 3회까지 중첩 가능)\n- {@green}방어력 증가 {@DEFAULT}: 방어력이 20% 증가됩니다. (최대 3회까지 중첩 가능)\n- {@green}공격속도 증가{@DEFAULT} : 공격속도가 20% 증가됩니다. (최대 3회까지 중첩 가능)\n- {@green}치명확률 증가{@DEFAULT} : 치명확률이 30% 증가됩니다.\n- {@green}치명피해 증가{@DEFAULT} : 치명피해가 50% 증가됩니다.\n- {@green}치명회피 증가{@DEFAULT} : 치명회피가 30% 증가됩니다.\n- {@green}회피 증가{@DEFAULT} : 회피가 30% 증가됩니다.\n- {@green}적중 증가{@DEFAULT} : 적중이 30% 증가됩니다.\n- {@green}무적{@DEFAULT} : 모든 피해를 받지 않습니다. 해로운 효과에는 걸릴 수 있습니다.\n- {@green}좀비{@DEFAULT} : 생명력이 0이 될 때 발동하며 죽지 않는 상태가 됩니다. 지속시간이 끝나면 바로 사망합니다.\n스킬에 따라 공격속도 300% 증가 혹은 치명확률 50% 증가의 비약적 증가 효과를 함께 얻습니다.\n- {@green}보호막{@DEFAULT} : 보호막이 가지고 있는 생명력 만큼의 피해를 방어합니다.\n- {@green}반사{@DEFAULT} : 적으로부터 받는 피해의 80%만 받으며 나머지 20%의 피해를 공격자에게 되돌립니다.\n- {@green}면역{@DEFAULT} : 모든 해로운 효과에 걸리지 않습니다. 이미 걸린 해로운 효과는 해제되지 않습니다.\n- {@green}흡혈{@DEFAULT} : 적에게 피해를 입혔을 때 피해량의 10%를 자신의 생명력으로 회복합니다.']='Naga sareng monster tiasa masihan épék mangpaat pikeun sekutu. \n\n- {@green} Ningkatkeun ATK{@DEFAULT}: ATK ngaronjat ku 20%. (Bisa ditumpuk nepi ka 3 kali) \n- {@green} Ningkatkeun DEF {@DEFAULT}: DEF ngaronjat ku 20%. (Bisa ditumpuk nepi ka 3 kali) \n- {@green} Ningkatkeun Kagancangan ATK {@DEFAULT}: Kacepetan ATK ningkat ku 20%. (Tiasa ditumpuk nepi ka 3 kali) \n- {@green} Ningkatkeun Laju Kritis{@DEFAULT}: Laju Kritis ngaronjat ku 30%. \n- {@green} Ningkatkeun DMG Kritis{@DEFAULT}: DMG Kritis ningkat ku 50%. \n- {@green} Ningkatkeun Évasi Kritis{@DEFAULT}: Évasi Kritis ningkat ku 30%. \n- {@green} Ningkatkeun Ngajauhan{@DEFAULT}: Ngajauhan ningkat ku 30%. \n- {@green} Ningkatkeun ACC{@DEFAULT}: ACC ngaronjat ku 30%. \n- {@green} Invulnerable{@DEFAULT}: Kebal kana sagala serangan, tapi tetep kapangaruhan ku épék ngabahayakeun. \n- {@green} Zombie{@DEFAULT}: Aktipkeun nalika HP ngahontal 0. Naga moal maot nepi ka durasina réngsé.\nKéngingkeun salah sahiji éfék dramatis ieu, 300% kanaékan ATK Speed ​​atawa 50% kanaékan Kritis Laju, nurutkeun kaahlian. \n- {@green} Panghalang{@DEFAULT}: Tahan karuksakan sarua jeung HP panghalang. \n- {@green} Reflect{@DEFAULT}: Ngan nampi 80% karusakan ti musuh, sareng mulangkeun 20% ka panyerang. \n- {@green} Kekebalan{@DEFAULT}: Kebal kana sagala épék ngabahayakeun. Balukar ngabahayakeun ayeuna teu dipiceun. \n- {@green} Nyerep HP{@DEFAULT}: Pulihkeun 10% karusakan anu dilakukeun ka musuh salaku HP.',
['드래곤과 몬스터들은 스킬을 통해서 적을 약하게 하는 효과를 부여할 수 있습니다.\n\n- {@YELLOW}공격력 감소{@DEFAULT} : 공격력이 20% 감소됩니다. (최대 3회까지 중첩 가능)\n- {@YELLOW}방어력 감소{@DEFAULT} : 방어력이 20% 감소됩니다. (최대 3회까지 중첩 가능)\n- {@YELLOW}공격속도 감소{@DEFAULT} : 공격속도가 20% 감소됩니다. (최대 3회까지 중첩 가능)\n- {@YELLOW}치명확률 감소{@DEFAULT} : 치명확률이 30% 감소됩니다.\n- {@YELLOW}치명회피 감소{@DEFAULT} : 치명회피가 30% 감소됩니다.\n- {@YELLOW}회피 감소{@DEFAULT} : 회피가 30% 감소됩니다.\n- {@YELLOW}적중 감소{@DEFAULT} : 적중이 30% 감소됩니다.\n- {@YELLOW}회복량 감소{@DEFAULT} : 회복을 받았을 때 회복량이 70% 감소됩니다.\n- {@YELLOW}기절{@DEFAULT} : 모든 일반공격과 스킬을 사용할 수 없습니다.\n- {@YELLOW}수면{@DEFAULT} : 모든 일반공격과 스킬을 사용할 수 없습니다. 공격을 받았을 때 해제됩니다.\n- {@YELLOW}침묵{@DEFAULT} : 모든 스킬을 사용할 수 없습니다.\n- {@YELLOW}지속피해{@DEFAULT} : 일정 시간마다 최대 생명력의 0.5%의 피해를 받습니다. (최대 3회까지 중첩 가능)']='Naga sareng monster tiasa masihan épék ngabahayakeun ka musuh. \n\n- {@YELLOW} Turunkeun ATK{@DEFAULT}: ATK turun 20%. (Bisa ditumpuk nepi ka 3 kali) \n- {@YELLOW} Turunkeun DEF {@DEFAULT}: DEF turun 20%. (Bisa ditumpuk nepi ka 3 kali) \n- {@YELLOW} Turunkeun Laju ATK {@DEFAULT}: Laju ATK Turun 20%. (Bisa ditumpuk nepi ka 3 kali) \n- {@YELLOW} Turunkeun Laju Kritis{@DEFAULT}: Laju Kritis turun 30%. \n- {@YELLOW} Turunkeun Évasi Kritis{@DEFAULT}: Évasi Kritis diréduksi ku 30%. \n- {@YELLOW} Turunkeun Ngajauhan{@DEFAULT}: Ngajauhan dikurangan ku 30%. \n- {@YELLOW} Turunkeun ACC{@DEFAULT}: ACC turun 30%. \n- {@YELLOW} Turunkeun Laju Pamulihan{@DEFAULT}: Jumlah pamulihan diturunkeun ku 70%. \n- {@YELLOW} Setrum{@DEFAULT}: Teu bisa nyerang atawa ngagunakeun kaahlian. \n- {@YELLOW} Saré{@DEFAULT}: Teu bisa maké sakabéh kaahlian jeung teu bisa nyerang. Status dihapus nalika diserang. \n- {@YELLOW} Jempé{@DEFAULT}: Teu bisa maké sakabéh kaahlian. \n- {@YELLOW} ruksakna titik{@DEFAULT}: Nampi 0,5% karuksakan tina Max HP unggal waktu disetel. (Bisa ditumpuk nepi ka 3 kali)',
