['드래곤들은 각각의 특성에 따라 {@RED}공격{@DEFAULT}, {@BLUE}방어{@DEFAULT}, {@grass_green}회복{@DEFAULT}, {@purple}지원{@DEFAULT} 중 하나의 직군을 가집니다.\n\n- {@RED}공격{@DEFAULT}: 몬스터들을 공격하는 것에 특화된 드래곤입니다.\n- {@BLUE}방어{@DEFAULT}: 아군 드래곤들 앞에서 몬스터의 공격을 방어하며 지켜주는 드래곤입니다.\n- {@grass_green}회복{@DEFAULT}: 충격을 입은 드래곤들의 HP를 회복하는 등 파티의 생존력을 높여주는 드래곤입니다.\n- {@purple}지원{@DEFAULT}: 아군 드래곤의 공격을 강화하거나, 몬스터의 공격을 방해하는 등 파티를 지원하는 드래곤입니다.']='Sadaya komodo gaduh 1 padamelan diantara ieu: {@RED} Serangan{@DEFAULT}, {@BLUE} Pertahanan{@DEFAULT}, {@grass_green} Pulihkeun{@DEFAULT}, atanapi {@purple} Rojongan{@DEFAULT}. \n\n- {@RED} Serangan{@DEFAULT}: Spésialisasi dina nyerang monster. \n- {@BLUE} Pertahanan{@DEFAULT}: Ngajaga komodo séjén di hareup. \n- {@grass_green} Pulihkeun{@DEFAULT}: Spésialisasi dina ningkatkeun kasalametan komodo sanés ku cara mulangkeun HP komodo anu ruksak. \n- {@purple} Rojongan{@DEFAULT}: Spésialisasi dina méré éfék mangpaat ka sekutu atawa éfék ngabahayakeun ka musuh.',
['드래곤들은 자신의 속성에 따라 식성이 다릅니다.\n테이머님이 좋아하는 드래곤은 어떤 열매가 취향일까요?']='Unggal naga gaduh diet anu béda-béda dumasar kana atributna.\nBuah naon anu dipikaresep ku naga favorit anjeun?',
