['드래곤에게 자립심을 길러주세요.']='Tong hilap ngamumule kamerdikaan diantara komodo anjeun.',
['드래곤에그가 아니라, 에그드래곤!']='Naga endog! Teu endog naga.',
['드래곤은 11종류의 능력치를 가지고 있으며 드래곤의 종류에 따라 시작 능력치가 다릅니다.\n공격력, 방어력, 생명력은 드래곤의 레벨업, 진화, 승급을 통해 상승시킬 수 있으며 그 외 능력치는 룬이나 스킬 등을 통해서만 상승시킬 수 있습니다.\n\n- {@RED}공격력{@DEFAULT} : 일반공격 및 스킬공격의 피해량이 증가됩니다.\n- {@pink}방어력{@DEFAULT} : 적의 공격을 받았을 때 피해량이 감소됩니다.\n- {@YELLOW}생명력{@DEFAULT} : 드래곤의 최대 생명력이 증가되어 더 오래 생존할 수 있습니다.\n- {@BLUE}공격속도{@DEFAULT} : 드래곤이 일반공격을 하는 빈도가 높아집니다.\n- {@purple}치명확률{@DEFAULT} : 드래곤이 공격을 할 때 치명타가 발생하는 확률이 증가됩니다.\n- {@pink}치명피해{@DEFAULT} : 드래곤의 공격에 치명타가 발생했을 때의 피해량이 증가됩니다.\n- {@green}치명회피{@DEFAULT} : 적에게 치명타를 받았을 때 치명타를 무효시키는 확률이 증가됩니다. 치명회피에 성공하면 치명타 피해가 아닌 일반 피해를 받게 됩니다.\n- {@YELLOW}회피{@DEFAULT} : 적의 공격을 회피하는 확률이 증가됩니다. 회피는 일반공격, 패시브 스킬, 드래그 스킬 등 모든 공격에 적용되며 회피에 성공하면 피해를 입지 않게 됩니다.\n- {@grass_green}적중{@DEFAULT} : 적에게 공격을 명중시키는 확률이 증가됩니다. 회피가 높은 적에게 유용합니다.\n- {@green}효과저항{@DEFAULT} : 적의 스킬로 해로운 효과가 발생할 때 효과를 무효시키는 확률이 증가됩니다.\n- {@RED}효과적중{@DEFAULT} : 효과저항을 가진 적의 저항 확률을 낮춥니다. 최소 15% 이하로는 효과저항을 낮추지 못합니다.']='Sadaya komodo gaduh 11 jinis stats, sareng stats standar beda-beda gumantung kana jinis naga.\nATK, DEF, HP tiasa ningkat ku Level-up, Évolusi, Rank-up, tapi statistik sanésna ngan ukur tiasa ningkat ku Runes atanapi Skills. \n\n- {@RED} ATK{@DEFAULT}: Ningkatkeun karusakan tina serangan sareng kaahlian normal. \n- {@pink} DEF{@DEFAULT}: Nampi langkung seueur karusakan nalika diserang. \n- {@YELLOW} HP{@DEFAULT}: Dragon\'s Max HP ditingkatkeun, sahingga tahan leuwih lila dina perang. \n- {@BLUE} ATK Speed{@DEFAULT}: Naga ngalakukeun serangan normal leuwih sering. \n- {@purple} Laju Kritis{@DEFAULT}: Kasempetan pikeun nimbulkeun Hit Kritis ningkat. \n- {@pink} DMG Kritis{@DEFAULT}: Karuksakan ngaronjat nalika naga nyitak Kritik Hit. \n- {@green} Ngajauhan Kritis{@DEFAULT}: Kasempetan pikeun ngabatalkeun Hit Kritis anu datang ningkat. Lamun komodo sukses kalawan Evasion kritis, butuh ruksakna normal gantina. \n- {@YELLOW} Évasion{@DEFAULT} : Kasempetan pikeun ngahindar tina serangan musuh ngaronjat. Ngajauhan diterapkeun ka sadaya serangan sapertos serangan normal, kaahlian pasip, Kaahlian sered, jsb. Naga henteu nampi karusakan upami berhasil ngajauhan serangan. \n- {@grass_green} ACC{@DEFAULT}: Kasempetan nabrak musuh ngaronjat. Statistik ieu penting nalika ngalawan musuh kalayan Evasion anu luhur. \n- {@green} Éfék Résistansi{@DEFAULT}: Kasempetan pikeun negate épék ngabahayakeun tina kaahlian musuh. \n- {@RED} Akurasi Pangaruh{@DEFAULT}: Turunkeun kasempetan musuh pikeun nolak pangaruh. Teu tiasa ngirangan Résistansi Pangaruh sahandapeun 15%.',
