['드래곤의 진화에 사용되는 각종 진화 재료를 얻을 수 있는 던전입니다.\n거대용들의 특성을 파악하고 속성을 공략해, 여러분의 드래곤을 진화시켜보세요.\n\n<보스 정보>\n- {@YELLOW}보석 거대용{@DEFAULT}: 보석 거대용은 생명력이 매우 높지만, 난이도 자체는 평범합니다.\n- {@grass_green}땅의 거대용{@DEFAULT}: 물속성 드래곤에게 큰 피해를 줍니다.\n- {@BLUE}물의 거대용{@DEFAULT}: 불속성 드래곤에게 큰 피해를 줍니다.\n- {@RED}불의 거대용{@DEFAULT}: 땅속성 드래곤에게 큰 피해를 줍니다.\n- {@YELLOW}빛의 거대용{@DEFAULT}: 어둠속성 드래곤에게 큰 피해를 줍니다.\n- {@GRAY}어둠의 거대용{@DEFAULT}: 빛속성 드래곤에게 큰 피해를 줍니다.']='Ieu mangrupikeun dungeon dimana anjeun tiasa nyandak rupa-rupa Bahan Évolusi anu dipikabutuh pikeun évolusi.\nPanggihan ciri-ciri Naga Massive sareng paké atributna ngalawan aranjeunna pikeun mekar komodo anjeun. \n\n<Boss Info> \n- {@YELLOW} Massive Gem Naga{@DEFAULT}: Massive Gem Naga gaduh HP anu luhur pisan, tapi henteu sesah dipaéhan. \n- {@grass_green} Naga bumi Masif {@DEFAULT}: Nimbulkeun karuksakan anu luhur ka Naga Cai . \n- {@BLUE} Naga Cai Masif {@DEFAULT}: Nimbulkeun karuksakan anu luhur ka Naga Seuneu . \n- {@RED} Naga seuneu Masif {@DEFAULT}: Nimbulkeun karuksakan anu luhur ka Naga bumi . \n- {@YELLOW} Naga Caang Masif {@DEFAULT}: Nimbulkeun karuksakan anu luhur ka Naga Poek . \n- {@GRAY} Naga Poek Masif {@DEFAULT}: Nimbulkeun karuksakan anu luhur ka Naga Caang .',
