['드래곤이 가진 스킬은 레벨이 높을 수록 스킬 능력이 강화되어 전투를 더 유리하게 진행할 수 있습니다.\n스킬의 레벨을 상승시키려면 {@YELLOW}같은 이름의 드래곤{@DEFAULT} 혹은 {@YELLOW}스킬 슬라임{@DEFAULT}이 필요하며, 최고 레벨이 아닌 보유 스킬 중 하나가 무작위로 레벨이 상승합니다.']='Kaahlian Naga janten langkung kuat sareng ngajantenkeun perangna langkung nguntungkeun pikeun anjeun nalika tingkatna naék.\nPikeun ningkatkeun tingkat kaahlian naga, anjeun peryogi {@YELLOW} naga anu sami{@DEFAULT} atanapi {@YELLOW} Skill Lendir{@DEFAULT} . Lajeng, tingkat kaahlian acak nu teu ngahontal Max Level ngaronjat.',
['드래곤이 가진 스킬의 종류에 따라 {@YELLOW}조건부로 발동{@DEFAULT}하는 자동 스킬입니다.\n발동 조건은 드래곤의 스킬에 따라 각각 다르며, 드래곤 관리 화면에서 확인하실 수 있습니다.']='Kaahlian otomatis {@YELLOW} diaktipkeun sacara kondisional{@DEFAULT}, gumantung kana jenis kaahlian naga anjeun.\nKondisi Aktipkeun béda jeung kaahlian komodo, sarta bisa dipariksa dina Tab Manajemén Naga .',
