['드래곤이 얼마나 희귀한지를 나타내는 정보입니다.\n드래곤이 희귀할수록 더 강하고 좋은 스킬을 가지고 있으며, 드래곤이 희귀할수록 드래곤의 최초 등급이 더 높습니다.\n\n- 일반 희귀도: 1~2등급 상태로 획득\n- {@BLUE}희귀 희귀도{@DEFAULT}: 3등급 상태로 획득\n- {@purple}영웅 희귀도{@DEFAULT}: 4등급 상태로 획득\n- {@YELLOW}전설 희귀도{@DEFAULT}: 5등급 상태로 획득']='Inpormasi ieu nunjukkeun kumaha langkana naga.\nNaga anu langkung jarang gaduh kaahlian anu langkung kuat sareng langkung saé, ogé Kelas awal anu langkung luhur. \n\n- Biasa: Kéngingkeun Kelas 1-2 \n- {@BLUE} Jarang{@DEFAULT}: Kéngingkeun Kelas 3 \n- {@purple} Heroik{@DEFAULT}: Kéngingkeun Kelas 4 \n- {@YELLOW} Legendaris{@DEFAULT}: Kéngingkeun Kelas 5',
['드래곤이 없습니다.']='Taya komodo di inventory.',
['드래곤이 좋아하는 열매를 얻을 수 있는 던전으로, 열매를 얻어 드래곤의 친밀도를 높일 수 있습니다.\n\n<보스 정보>\n- {@grass_green}땅의 거목{@DEFAULT}: 물속성 드래곤에게 큰 피해를 줍니다.\n- {@BLUE}물의 거목{@DEFAULT}: 불속성 드래곤에게 큰 피해를 줍니다.\n- {@RED}불의 거목{@DEFAULT}: 땅속성 드래곤에게 큰 피해를 줍니다.\n- {@YELLOW}빛의 거목{@DEFAULT}: 어둠속성 드래곤에게 큰 피해를 줍니다.\n- {@GRAY}어둠의 거목{@DEFAULT}: 빛속성 드래곤에게 큰 피해를 줍니다.']='Ieu dungeon mana anjeun bisa meunangkeun rupa-rupa bungbuahan nu komodo anjeun resep, jeung anjeun bisa ningkatkeun Closeness jeung bungbuahan ieu. \n\n<Boss Info> \n- {@grass_green} Tangkal bumi Masif{@DEFAULT}: Nimbulkeun karuksakan anu luhur ka Naga Cai . \n- {@BLUE} Tangkal Cai Masif{@DEFAULT}: Nimbulkeun karuksakan anu luhur ka Naga Seuneu . \n- {@RED} Tangkal Seuneu Masif{@DEFAULT}: Nimbulkeun karuksakan anu luhur ka Naga bumi . \n- {@YELLOW} Tangkal Caang Masif{@DEFAULT}: Nimbulkeun karuksakan anu luhur ka Naga Poek . \n- {@GRAY} Tangkal Poek Masif{@DEFAULT}: Nimbulkeun karuksakan anu luhur ka Naga Caang .',
['드래곤이 희귀할수록 처음 획득했을 때의 등급이 높아집니다.\n다만 낮은 등급의 드래곤도 계속 키워나가면 6등급까지 성장시킬 수 있으니, 맘에 드는 드래곤을 마지막까지 함께 하실 수 있습니다.']='Nu leuwih langka naga, nu leuwih luhur Kelas awal na.\nNanging, komodo jeung kelas awal handap bisa tumuwuh nepi ka Kelas 6, jadi Anjeun bisa nyimpen naga nu Anjeun pikaresep nepi ka ahir.',
