Ngan nampi 80% karusakan ti musuh, sareng mulangkeun 20% ka panyerang. \n- {@green} Kekebalan{@DEFAULT}: Kebal kana sagala épék ngabahayakeun. Balukar ngabahayakeun ayeuna teu dipiceun. \n- {@green} Nyerep HP{@DEFAULT}: Pulihkeun 10% karusakan anu dilakukeun ka musuh salaku HP.',
