['클랜원들이 힘을 합쳐 강력한 보스를 토벌하는 던전입니다.\n클랜던전에서는 {@YELLOW}10마리{@DEFAULT}의 드래곤을 {@YELLOW}2팀{@DEFAULT}으로 나누어서 전투를 진행하며\n다른 클랜원이 전투중일 경우 입장할 수 없습니다.\n보스의 남은 체력은 모든 클랜원에게 공유되며\n보스의 생명력이 {@YELLOW}5% 이하{@DEFAULT}의 상태에서 승리하지 못했을 경우 다음 전투에서 {@YELLOW}5%까지 생명력을 회복{@DEFAULT}합니다\n\n보스에게 승리하면 클랜원 전체에게 {@YELLOW}클리어 보상{@DEFAULT}이 지급되고 다음 레벨의 보스에 도전할 수 있습니다.\n보스는 레벨이 높아질 때마다 점점 강해집니다.\n\n보스의 속성은 {@YELLOW}시즌이 시작될때 결정{@DEFAULT}되어 {@YELLOW}시즌 종료까지 유지{@DEFAULT}됩니다.']='Ieu dungeon tempat Anggota Klan ngariung babarengan pikeun ngelehkeun Bos anu kuat.\nDina Clan Dungeon, anjeun tiasa gaduh {@YELLOW} 10{@DEFAULT} naga dibagi jadi {@YELLOW} 2 tim{@DEFAULT} pikeun perang.\nNalika nu sejen Anggota Klan nuju perang, anjeun teu tiasa lebet.\nHP Boss anu sesa dibagi ka sadaya Anggota Klan.\nUpami anjeun eleh nalika HP Bos {@YELLOW} 5% atanapi langkung handap{@DEFAULT}, éta {@YELLOW} meunangkeun deui HP-na nepi ka 5%{@DEFAULT} dina perang salajengna. \n\nNalika bos eleh, {@YELLOW} Clear Reward{@DEFAULT} dikaluarkeun ka sadaya Anggota Klan, sareng aranjeunna tiasa nantang Boss anu langkung kuat.\nSawaktos Level Bos naek, éta bakal langkung kuat. \n\nAtribut bos nyaéta {@YELLOW} disetel dina awal musim{@DEFAULT} sarta bakal {@YELLOW} disimpen sapanjang musim{@DEFAULT}.',
['클랜은 서로 뜻이 맞는 테이머님들이 연합할 수 있는 단체입니다.\n{@YELLOW}레벨 15{@DEFAULT} 이상의 테이머님은 클랜을 새로 만들거나 가입할 수 있습니다.\n클랜원들이 {@YELLOW}고대의 탑, 콜로세움, 클랜던전{@DEFAULT}에 참여하면 성적에 따라 클랜 랭킹이 집계되고\n{@YELLOW}클랜코인{@DEFAULT} 보상을 받을 수 있습니다. 클랜코인은 상점에서 희귀한 물품과 교환할 수 있습니다.']='Klan nyaéta organisasi dimana panyawat anu boga tujuan anu sarua bisa ngahiji.\nTamers di {@YELLOW} Tingkat 15{@DEFAULT} atawa saluhureuna bisa nyieun klan anyar atawa ngagabung ka clan nu geus aya.\nNalika Anggota Klan milu dina {@YELLOW} Menara Kuno, Colosseum, atanapi Clan Dungeon{@DEFAULT}, Peringkat Klanna bakal diitung dumasar kana hasil,\na sareng {@YELLOW} Clan Coin{@DEFAULT} tiasa dimeunangkeun. Koin Clan tiasa disilihtukeurkeun pikeun barang langka di toko.',
