['고대 유적 던전에서 발견할 수 있는 고대 룬은 일반 룬에는 없는 특별한 효과를 가지고 있습니다. \n현재 발견된 고대 룬의 종류는 6가지로, 그 효과는 다음과 같습니다.\n\n- {@RED}흡혈 룬{@DEFAULT} : 자신이 준 피해량의 10% 만큼 생명력을 회복합니다.\n세트 효과 중복 시 회복량이 증가합니다.\n- {@BLUE}명상 룬{@DEFAULT} : 12초마다 마나 1개를 획득합니다.\n- {@YELLOW}반격 룬{@DEFAULT} : 피해를 받으면 공격한 대상에게 즉시 반격합니다.\n반격에는 1초의 재사용 시간이 존재하며, 피해량은 자신의 방어력과 최대 생명력에 비례합니다.\n- {@GRAY}생존 룬{@DEFAULT} : 생명력이 30% 이하가 될 때 5초간 무적 효과를 적용받습니다.\n세트 효과 적용 시 무적 시간이 증가합니다.\n- {@grass_green}결의 룬{@DEFAULT} : 자신보다 후방에 위치한 아군이 받는 피해를 20% 확률로 대신 받습니다.\n- {@purple}앙심 룬{@DEFAULT} : 피해를 받을 때 20% 확률로 드래그 스킬 재사용 시간이 1초 감소합니다.\n세트 효과 중복 시 효과 발동 확률이 증가합니다.']='Runes Kuno kapanggih dina Runes Kuno Dungeon gaduh épék unik teu kapanggih dina sagala Runes normal. \nAyeuna, aya 6 jinis Rune Kuno. Balukarna nyaéta kieu. \n\n- {@RED} HP Absorption Rune{@DEFAULT}: Pulihkeun HP sami sareng 10% karusakan anu ditimbulkeun ka musuh.\nNalika épék set ditumpuk, jumlah pamulihan bakal ningkat. \n- {@BLUE} Rune Meditation{@DEFAULT}: Kéngingkeun 1 Mana unggal 12 detik. \n- {@YELLOW} Balas Serangan Rune{@DEFAULT}: Lamun ruksak, langsung nyerang deui.\nAya 1 detik. cooldown sanggeus unggal counterattack, jeung karuksakan sabanding jeung DEF anjeun sarta Max HP. \n- {@GRAY} Survival Rune{@DEFAULT}: Jadi kebal salila 5 detik. lamun HP ngahontal handap 30%.\nDurasi ngaronjat lamun set éfék aktip. \n- {@grass_green} Rune Determination{@DEFAULT}: 20% kasempetan pikeun ngarusak sekutu di tukangeunana. \n- {@purple} Grudge Rune{@DEFAULT}: 20% kasempetan pikeun ngurangan Drag skill cooldown ku 1 detik. lamun ruksak.\nLaju aktivasina ngaronjat lamun efek set tumpuk.',
