['드래곤 빌리지M의 무대가 되는 유타칸 세계에서 벌어지는 {@YELLOW}이야기{@DEFAULT}를 따라가며\n테이머와 드래곤을 {@YELLOW}성장{@DEFAULT}시킬 수 있습니다.']='Nuturkeun carita {@YELLOW}{@DEFAULT} Yutakan, dunya Dragon Village M,\na jeung {@YELLOW} naek level{@DEFAULT} tamers jeung naga anjeun.',
['모험 도중 우연히 만난 드래곤의 기억속에서 {@YELLOW}인연 포인트{@DEFAULT}를 얻을 수 있습니다.\n\n드래곤의 인연 포인트가 쌓이면 부화소에서 함께 할 수 있는 동료로 소환 할 수 있습니다.\n테이머님의 친구가 발견한 인연 던전에도 들어갈 수 있습니다.']='Kéngingkeun {@YELLOW} Poin Hubungan{@DEFAULT} tina kenangan komodo anu anjeun tepang salami petualangan anjeun. \n\nKalayan Relationship Points, anjeun tiasa ngagero babaturan anjeun di Hatchery (Summon). \nAnjeun oge bisa ngasupkeun Relationship Dungeons nu kapanggih ku babaturan anjeun.',
['보유한 드래곤을 유타칸의 다양한 지역으로 {@YELLOW}탐험{@DEFAULT}을 보내 {@YELLOW}성장{@DEFAULT}시킬 수 있습니다.\n\n탐험을 보내기 위해서는 5마리의 드래곤이 필요하며, 탐험에서 발견한 룬과 자수정을 가지고 돌아옵니다.']='Kirim komodo anjeun ka {@YELLOW} ngajalajah{@DEFAULT} wewengkon séjén Yutakan ka {@YELLOW} level up{@DEFAULT}. \n\nAnjeun peryogi sahenteuna lima naga pikeun ngirim pikeun éksplorasi. Nalika aranjeunna balik, aranjeunna mawa deui Runes na Amethysts aranjeunna geus kapanggih.',
['하루에 한번 {@YELLOW}저렴한 가격{@DEFAULT}으로 상품을 구매할 수 있습니다.\n\n고급소환권과 골드, 모험에서 사용가능한 경험치와 골드 부스터 상품을 판매하고 있습니다.']='Sadinten sakali, anjeun tiasa ngagaleuh barang-barang kalayan harga {@YELLOW} langkung handap{@DEFAULT}. \n\nTiket Summon Lanjutan, emas, Boosters emas , sareng EXP anu tiasa anjeun anggo salami petualangan anjeun sayogi kanggo ngagaleuh.',
['오랜 시간 유타칸 세계의 신비한 힘을 흡수해 살아 움직이게 된 {@YELLOW}거목{@DEFAULT}이 등장합니다.\n\n거목을 물리치면 드래곤의 친밀도를 올리는 {@YELLOW}열매{@DEFAULT}를 얻을 수 있습니다.\n\n요일에 따라 들어갈 수 있는 던전의 속성이 변화합니다.']='Aya {@YELLOW} Tangkal Masif{@DEFAULT} anu hirup saatos nyerep kakuatan misterius Yutakan. \n\nNalika anjeun ngéléhkeun tangkal éta, anjeun tiasa kéngingkeun rupa-rupa buah {@YELLOW}{@DEFAULT} sareng ningkatkeun Deukeut anjeun sareng Naga. \n\nAtribut dungeon anu anjeun tiasa lebetkeun robih unggal dinten dina saminggu.',
['태초의 드래곤의 힘이 담긴 진화의 보석과 자연의 정기를 지키고 있는 거대용들의 서식지입니다.\n\n거대용들을 물리치면 {@YELLOW}드래곤을 진화{@DEFAULT}시킬 수 있는 {@YELLOW}보석과 정기{@DEFAULT}를 얻을 수 있습니다.\n진화한 드래곤은 모습이 변화하며 새로운 스킬을 얻어 더욱 강해집니다.\n\n요일에 따라 들어갈 수 있는 던전의 속성이 변화합니다.']='Éta mangrupikeun habitat Naga Massive anu ngajaga Permata Évolusi sareng Énergi anu ngandung kakuatan naga. \n\nLamun anjeun ngéléhkeun Massive Dragons, anjeun meunang {@YELLOW} Évolusi Permata jeung Énergi{@DEFAULT} anu memicu {@YELLOW} Évolusi Naga{@DEFAULT}.\nNalika naga geus mekar, éta robah penampilan na. jadi leuwih kuat jeung kaahlian anyar. \n\nAtribut dungeon anu anjeun tiasa lebetkeun robih unggal dinten dina saminggu.',
['먼 옛날부터 테이머들이 자신을 시험하기 위해 올라갔다고 하는 전설의 탑입니다.\n\n더 높은 층으로 올라갈 수록 더욱 강력한 드래곤들을 물리쳐야만 합니다.\n매 층 클리어 시 다양한 보상을 얻을 수 있으며, {@YELLOW}층별 점수에 따라 순위가 결정{@DEFAULT}됩니다.\n\n고대의 탑은 2주마다 시즌이 종료되며 순위에 따라 {@YELLOW}고대주화{@DEFAULT}를 얻을 수 있습니다.']='Hiji munara legendaris nu Tamers naek lila pisan pikeun nguji diri. \n\nAnjeun ngalawan komodo anu langkung kuat nalika anjeun naek.\nAnjeun meunang rupa-rupa ganjaran nalika anjeun ngabersihan unggal lantai, sareng anjeun {@YELLOW} rengking, dumasar kana poin anu anjeun cetak pikeun tiap lantai{@DEFAULT}. \n\nUnggal usum Menara Kuno salami 2 minggu, sareng anjeun tiasa kéngingkeun {@YELLOW} Koin Kuno{@DEFAULT} dumasar kana peringkat anjeun.',
['마녀 나르비는 자신의 연구에 필요한 고대 주화를 수집하기 위해 상점을 열었습니다.\n고대의 탑에서 얻은 고대 주화를 {@YELLOW}드래곤 인연 포인트{@DEFAULT}와 다양한 아이템으로 교환할 수 있습니다.\n\n나르비의 변덕으로 상품이 주기적으로 바뀌는 특징이 있습니다.']='Narvi muka toko pikeun ngumpulkeun Koin Kuno pikeun panalungtikanana.\nKoin Kuno nu Anjeun kumpulkeun ti Menara Kuno bisa ditukeurkeun ku {@YELLOW} Titik Hubungan Naga{@DEFAULT} jeung barang-barang lianna. \n\nManehna ngarobah barang-barang anu dijual sakali-kali, gumantung kana wandana.',
['콜로세움은 다른 테이머들과 강함을 겨룰 수 있는 경쟁의 무대입니다.\n\n전투에 참가한 테이머는 {@YELLOW}명예{@DEFAULT}를 획득할 수 있으며 승패에 따라 순위가 변동됩니다.\n매주 주말마다 시즌이 종료되며 순위에 따라 {@YELLOW}용맹 훈장{@DEFAULT}과 다이아를 얻을 수 있습니다.\n\n콜로세움에서 획득한 명예와 용맹 훈장은 상점에서 특별한 상품들과 교환 할 수 있습니다.']='Colosseum mangrupikeun medan perang dimana anjeun tiasa bersaing ngalawan tamers anu sanés. \n\nLamun anjeun miluan perang, anjeun bisa meunangkeun {@YELLOW} Honor{@DEFAULT} sarta anjeun bakal dibéré peringkat dumasar kana hasilna.\nUnggal usum réngsé dina sabtu minggu, sarta anjeun meunang {@YELLOW} Valor Medal{@ DEFAULT} jeung Inten nurutkeun ranking Anjeun. \n\nMedali Honor sareng Valor anu anjeun kumpulkeun di Colosseum tiasa ditukeurkeun kana barang-barang khusus di toko.',
['오래된 유적에서 발견된 신기한 캡슐을 뽑을 수 있는 곳입니다.\n\n캡슐을 뽑기위해서는 유타칸의 장인들이 가공한 {@YELLOW}캡슐 코인{@DEFAULT}이 필요합니다.\n캡슐중에는 {@YELLOW}전설 드래곤{@DEFAULT}과 같이 희귀한 상품이 들어있는 것도 있어 테이머들에게 늘 인기입니다.']='Ieu mangrupikeun tempat anjeun tiasa ngagambar kapsul misterius anu dipendakan di ruruntuhan kuno. \n\nPikeun ngagambar kapsul, anjeun peryogi {@YELLOW} Koin Kapsul{@DEFAULT} anu diolah ku panday di dunya Yutakan.\nKapsul populer di kalangan tamers sabab ngandung barang langka sapertos {@YELLOW} Naga Legendaris{@DEFAULT }.',
['수많은 테이머와 드래곤을 괴롭힌 악몽의 화신이 살고있는 던전입니다.\n그들의 처절했던 전투의 흔적과 함께 룬들이 곳곳에 떨어져 있어 테이머를 유혹합니다.\n\n악몽의 화신을 물리치면 룬을 얻을 수 있고 {@YELLOW}높은 단계로 갈수록 등급이 더 높은 룬{@DEFAULT}을 얻을 수 있습니다.']='Ieu dungeon dimana loba tamers jeung komodo geus diserang ku Incarnation of Nightmare.\nTamers digoda ku Runes sumebar di sakuliah tempat, babarengan jeung ngambah perang putus asa. \n\nNalika anjeun ngéléhkeun Incarnation of Nightmare, anjeun meunang Runes. {@YELLOW} Beuki jauh anjeun, beuki luhur kelas Runes{@DEFAULT}.',
['테이머님과 드래곤이 휴식하고 서로 교감할 수 있는 숲입니다.\n\n{@YELLOW}숲의 레벨{@DEFAULT}을 올리면 더 많은 드래곤이 머무를 수 있고,\n시설의 레벨을 올릴 수 있어 보다 많은 보상을 얻을 수 있습니다.']='Di leuweung, tamers sareng komodo tiasa istirahat sareng saling berinteraksi. \n\nLangkung luhur {@YELLOW} tingkat leuweung anjeun{@DEFAULT}, langkung seueur komodo tiasa cicing.\nAnjeun ogé tiasa ningkatkeun tingkat fasilitas, anu nyababkeun langkung seueur ganjaran.',
['유타칸의 테이머들은 혼자의 힘만으로는 물리칠 수 없는 어둠의 존재에 대항할 방법이 필요했습니다.\n클랜은 이러한 뜻이 맞는 테이머들이 연합할 수 있는 단체입니다.\n\n클랜에 소속되면 클랜 레벨에 따라 {@YELLOW}전용 버프 혜택{@DEFAULT}을 받을 수 있습니다.\n테이머는 클랜활동의 성과에 따라 상점에서 특별한 상품과 교환 할 수 있는 {@YELLOW}클랜코인{@DEFAULT}을 얻을 수 있습니다.']='Di dunya Yutakan, tamers kedah milarian jalan pikeun ngahiji sareng ngalawan pasukan gelap anu moal tiasa diéléhkeun upami aranjeunna perang nyalira.\nA clan mangrupikeun grup tamers anu parantos ngahiji pikeun tujuan ieu. \n\nLamun anjeun kaasup kana hiji klan, anjeun bakal meunang {@YELLOW} clan buff{@DEFAULT}, gumantung kana tingkat klan.\nDumasar kagiatan klan, tamers meunang {@YELLOW} Clan Coin{@DEFAULT } nu bisa disilihtukeurkeun pikeun item husus di warung.',
['테이머 연합에서는 테이머들의 실력 향상을 위해 그림자의 신전을 만들었습니다.\n\n이곳에서는 전 세계의 우수한 테이머와 드래곤의 능력을 똑같이 가진 그림자가 나타납니다.\n하지만 이런 강력한 그림자에게 도전하기 위해서는 먼저 콜로세움에서 자신의 강함을 증명해야만 합니다.\n\n그림자의 신전에서는 룬을 연마할 수 있는 {@YELLOW}룬 연마석{@DEFAULT}을 획득 할 수 있습니다.']='Tamer Alliance parantos ngawangun Candi Bayangan pikeun ningkatkeun kamampuan sareng kaahlian tamers. \n\nDi kuil, aya kalangkang anu gaduh statistik anu sami sareng tamers sareng komodo luhur di sakumna dunya.\nTapi, pikeun ngalawan kalangkang, anjeun kedah ngabuktikeun kakuatan anjeun di Colosseum. \n\nDi Candi of Shadows, anjeun tiasa kéngingkeun {@YELLOW} Rune Enchant Stone{@DEFAULT}.',
['고대의 탑에서 자신의 한계를 뛰어넘은 테이머만이 찾을 수 있는 신비로운 탑입니다.\n\n시험의 탑은 강력한 원소 에너지로 인해 {@YELLOW}탑과 같은 속성의 드래곤{@DEFAULT}만 전투에 참여할 수 있습니다.\n각 속성별 탑을 정복하면 한정 드래곤을 얻을 수 있는 {@YELLOW}절대적인 전설의 알{@DEFAULT}을 얻을 수 있습니다.']='Ngan jalma anu geus ngaleuwihan wates maranéhanana di Menara Kuno bisa manggihan munara misterius ieu. \n\nDi Tower of Tests, ngan {@YELLOW} naga jeung atribut nu sarua jeung munara{@DEFAULT} bisa gabung dina perangna alatan énergi unsur kuat na.\nNalika anjeun mupus munara unggal atribut, anjeun bisa meunangkeun hiji {@YELLOW} Endog Legendaris Absolute {@DEFAULT} nu netas jadi naga kawates.',
['어둠의 추종자가 부활시킨 강력한 기계 드래곤 엑스 마키나가 활동하고 있는 던전입니다.\n\n테이머 협회는 악명이 자자한 악몽던전에서도 살아 돌아온 뛰어난 테이머만의 입장을 허락하고 있습니다.\n{@YELLOW}총 10마리의 드래곤이 전투에 참가{@DEFAULT} 할 수 있으며, 엑스 마키나를 물리치면 특별한 능력을 가진 {@YELLOW}고대 룬{@DEFAULT}과 \n드래곤의 특성 레벨을 올리는 데 사용되는 {@YELLOW}아모르의 서{@DEFAULT}를 얻을 수 있습니다.']='The Ex Machina, naga mékanis kuat dibangkitkeun ku pengikut gelap, hirup di dungeon ieu. \n\nTamer Alliance ngan ukur ngamungkinkeun jalma-jalma anu salamet tina dungeon Nightmare anu kasohor pikeun asup. \n{@YELLOW} Nepi ka 10 komodo tiasa ngiluan perang {@DEFAULT} sareng nalika anjeun ngéléhkeun Ex Machina, anjeun tiasa nampi {@YELLOW} Rune Kuno{@DEFAULT} anu gaduh kaahlian khusus sareng\n{@YELLOW} Buku Amorru{@DEFAULT} anu digunakeun pikeun Ngawasa Level-up.',
['태초의 룬의 힘을 가졌다고 전해지는 룬 수호자가 지키는 던전입니다.\n\n룬 수호자 던전은 마력의 흐름이 불안정해 {@YELLOW}드래그 스킬을 사용할 수 없습니다{@DEFAULT}.\n총 6개의 던전으로 나누어진 룬 수호자 던전은, 각각의 던전마다 {@YELLOW}정해진 종류의 룬{@DEFAULT}을 얻을 수 있습니다.\n테이머는 원하는 종류의 룬을 얻기 위해 던전을 선택해 입장 할 수 있습니다.']='dungeon ieu dijaga ku Rune Guardian dipikawanoh boga kakuatan rune munggaran. \n\nDina Rune Guardians Dungeon, {@YELLOW} Drag Skill henteu tiasa dianggo{@DEFAULT} kusabab aliran sihir henteu stabil.\nDiwangun ku 6 dungeon, anjeun tiasa kéngingkeun {@YELLOW} jinis Rune khusus. {@DEFAULT} di unggal dungeon.\nAnjeun tiasa milih dungeon pikeun meunangkeun jinis Rune anu dipikahoyong.',
['오랜세월 잠들어 있던 죄악의 화신이 어둠의 세력에 의해 되살아났습니다.\n클랜원들은 힘을 합쳐 죄악의 화신을 막아내야 합니다.\n\n클랜던전에서는 {@YELLOW}10마리의 드래곤{@DEFAULT}으로 전투를 진행하며 다른 클랜원이 전투중일 경우 입장할 수 없습니다.\n보스의 남은 체력은 모든 클랜원에게 공유되며 보스에게 승리하면 더 강한 보스에게 도전할 수 있습니다.\n\n클랜던전은 1주마다 시즌이 종료되며, {@YELLOW}보스에게 입힌 피해량에 따라 보상을 얻을 수 있습니다.{@DEFAULT}']='Inkarnasi Dosa dihirupkeun deui ku kakuatan gelap sanggeus saré lila.\nAyeuna, anggota klan kudu ngahiji pikeun merangan kakuatan jahat ieu. \n\nDina Clan Dungeon, anjeun gelut sareng {@YELLOW} 10 naga{@DEFAULT}, sareng anjeun moal tiasa lebet ka dungeon nalika ditempatan ku anggota anu sanés.\nHp Boss tetep sami pikeun sadaya anggota klan. Nalika anjeun ngéléhkeun bos, anjeun tiasa ngalawan bos anu langkung kuat. \n\nUnggal usum dungeon salami saminggu, sareng {@YELLOW} anjeun tiasa nampi ganjaran dumasar kana karusakan anu ditanggung ka bos.{@DEFAULT}',
['모험 도중 우연히 만난 드래곤의 기억속에서 {@YELLOW}인연 포인트{@DEFAULT}를 얻을 수 있습니다.\n드래곤의 인연 포인트가 쌓이면 부화소에서 함께 할 수 있는 동료로 소환 할 수 있습니다.\n테이머님의 친구가 발견한 인연 던전에도 들어갈 수 있습니다.']='Kéngingkeun {@YELLOW} Poin Hubungan{@DEFAULT} tina kenangan komodo anu anjeun tepang salami petualangan anjeun.\nKalayan Relationship Points, anjeun tiasa ngagero réréncangan anjeun di Hatchery (Panggilan). \nAnjeun oge bisa ngasupkeun Relationship Dungeons nu kapanggih ku babaturan anjeun.',
['보유한 드래곤을 유타칸의 다양한 지역으로 {@YELLOW}탐험{@DEFAULT}을 보내 {@YELLOW}성장{@DEFAULT}시킬 수 있습니다.\n탐험을 보내기 위해서는 5마리의 드래곤이 필요하며, 탐험에서 발견한 룬과 자수정을 가지고 돌아옵니다.']='Kirim komodo anjeun ka {@YELLOW} ngajalajah{@DEFAULT} wewengkon séjén Yutakan ka {@YELLOW} level up{@DEFAULT}.\nAnjeun peryogi sahenteuna lima naga pikeun ngirim eksplorasi. Nalika aranjeunna balik, aranjeunna mawa deui Runes na Amethysts aranjeunna geus kapanggih.',
['하루에 한번 {@YELLOW}저렴한 가격{@DEFAULT}으로 상품을 구매할 수 있습니다.\n고급소환권과 골드, 모험에서 사용가능한 경험치와 골드 부스터 상품을 판매하고 있습니다.']='Sadinten sakali, anjeun tiasa ngagaleuh barang-barang kalayan harga {@YELLOW} langkung handap{@DEFAULT}.\nTiket Summon Lanjutan, emas, Penguat emas , sareng EXP anu tiasa anjeun anggo salami petualangan anjeun sayogi kanggo mésér.',
['오랜 시간 유타칸 세계의 신비한 힘을 흡수해 살아 움직이게 된 {@YELLOW}거목{@DEFAULT}이 등장합니다.\n거목을 물리치면 드래곤의 친밀도를 올리는 {@YELLOW}열매{@DEFAULT}를 얻을 수 있습니다.\n요일에 따라 들어갈 수 있는 던전의 속성이 변화합니다.']='Aya {@YELLOW} Tangkal Masif{@DEFAULT} anu hirup sanggeus nyerep kakuatan misterius Yutakan.\nNalika anjeun ngéléhkeun tangkal éta, anjeun bisa meunangkeun rupa-rupa bungbuahan {@YELLOW}{@DEFAULT} jeung ningkatkeun Deukeut anjeun jeung Naga. .\nAtribut dungeon anu anjeun tiasa lebetkeun robih unggal dinten dina saminggu.',
['거대용들을 물리치면 {@YELLOW}드래곤을 진화{@DEFAULT}시킬 수 있는 {@YELLOW}보석과 정기{@DEFAULT}를 얻을 수 있습니다.\n진화한 드래곤은 모습이 변화하며 새로운 스킬을 얻어 더욱 강해집니다.\n요일에 따라 들어갈 수 있는 던전의 속성이 변화합니다.']='Lamun anjeun ngéléhkeun Massive Dragons, anjeun meunang {@YELLOW} Évolusi Permata jeung Énergi{@DEFAULT} anu memicu {@YELLOW} Évolusi Naga{@DEFAULT}.\nLamun naga geus mekar, éta robah penampilan sarta jadi leuwih kuat. kalawan kaahlian anyar.\nAtribut tina dungeon anjeun bisa ngasupkeun robah pikeun tiap dinten dina saminggu.',
['먼 옛날부터 테이머들이 자신을 시험하기 위해 올라갔다고 하는 전설의 탑입니다.\n매 층 클리어 시 다양한 보상을 얻을 수 있으며, {@YELLOW}층별 점수에 따라 순위가 결정{@DEFAULT}됩니다.\n고대의 탑은 2주마다 시즌이 종료되며 순위에 따라 {@YELLOW}고대주화{@DEFAULT}를 얻을 수 있습니다.']='Hiji munara legendaris nu Tamers naek lila pisan pikeun nguji diri. \nAnjeun meunang rupa-rupa ganjaran mun anjeun ngabersihan unggal lantai, sarta anjeun {@YELLOW} rengking, dumasar kana poin anu anjeun cetak pikeun tiap lantai{@DEFAULT}.\nUnggal musim Menara Kuno lumangsung salila 2 minggu, sarta anjeun bisa meunangkeun {@YELLOW} Koin Purba{@DEFAULT} dumasar kana ranking anjeun.',
['마녀 나르비는 자신의 연구에 필요한 고대 주화를 수집하기 위해 상점을 열었습니다.\n고대의 탑에서 얻은 고대 주화를 {@YELLOW}드래곤 인연 포인트{@DEFAULT}와 다양한 아이템으로 교환할 수 있습니다.\n나르비의 변덕으로 상품이 주기적으로 바뀌는 특징이 있습니다.']='Narvi muka toko pikeun ngumpulkeun Koin Kuno pikeun panalungtikanana.\nKoin Kuno nu Anjeun kumpulkeun ti Menara Kuno bisa ditukeurkeun ku {@YELLOW} Titik Hubungan Naga{@DEFAULT} jeung barang-barang lianna.\nAnjeunna ngarobah barang-barang nu dijual unggal sakali-kali, gumantung kana wandana.',
['콜로세움은 다른 테이머들과 강함을 겨룰 수 있는 경쟁의 무대입니다.\n전투에 참가한 테이머는 {@YELLOW}명예{@DEFAULT}를 획득할 수 있으며 승패에 따라 순위가 변동됩니다.\n매주 주말마다 시즌이 종료되며 순위에 따라 {@YELLOW}용맹 훈장{@DEFAULT}과 다이아를 얻을 수 있습니다.']='Colosseum mangrupikeun medan perang dimana anjeun tiasa bersaing ngalawan tamers anu sanés.\nNalika anjeun ngiringan perang, anjeun tiasa kéngingkeun {@YELLOW} Honor{@DEFAULT} sareng anjeun bakal réngking dumasar kana hasilna.\nUnggal usum réngsé dina sabtu minggu, sareng anjeun meunang {@YELLOW} Valor Medal{@DEFAULT} jeung Inten numutkeun ranking anjeun.',
