['테이머님과 드래곤이 휴식하고 서로 교감할 수 있는 숲입니다.\n{@YELLOW}숲의 레벨{@DEFAULT}을 올리면 더 많은 드래곤이 머무를 수 있고,\n시설의 레벨을 올릴 수 있어 보다 많은 보상을 얻을 수 있습니다.']='Di leuweung, tamers sareng komodo tiasa istirahat sareng silih berinteraksi.\nLangkung luhur {@YELLOW} tingkat leuweung anjeun{@DEFAULT}, langkung seueur komodo tiasa cicing.\nAnjeun ogé tiasa ningkatkeun tingkat fasilitas, anu hasilna leuwih ganjaran.',
['클랜에 소속되면 클랜 레벨에 따라 {@YELLOW}전용 버프 혜택{@DEFAULT}을 받을 수 있습니다.\n테이머는 클랜활동의 성과에 따라 상점에서 특별한 상품과 교환 할 수 있는 {@YELLOW}클랜코인{@DEFAULT}을 얻을 수 있습니다.']='Lamun anjeun jadi anggota klan, anjeun bakal meunang {@YELLOW} clan buff{@DEFAULT}, gumantung kana tingkat clan.\nDumasar kagiatan klan, tamers meunang {@YELLOW} Clan Coin{@DEFAULT} anu bisa disilihtukeurkeun pikeun barang-barang khusus di toko.',
['이곳에서는 전 세계의 우수한 테이머와 드래곤의 능력을 똑같이 가진 그림자가 나타납니다.\n하지만 이런 강력한 그림자에게 도전하기 위해서는 먼저 콜로세움에서 자신의 강함을 증명해야만 합니다.\n그림자의 신전에서는 룬을 연마할 수 있는 {@YELLOW}룬 연마석{@DEFAULT}을 획득 할 수 있습니다.']='Di kuil, aya kalangkang nu boga statistik sarua jeung tamers luhur jeung komodo di sakuliah dunya.\nTapi, pikeun ngalawan kalangkang, Anjeun kudu ngabuktikeun kakuatan Anjeun di Colosseum.\nDi Candi of Shadows, Anjeun bisa meunangkeun {@YELLOW} Rune Enchant Stone{@DEFAULT}.',
['고대의 탑에서 자신의 한계를 뛰어넘은 테이머만이 찾을 수 있는 신비로운 탑입니다.\n시험의 탑은 강력한 원소 에너지로 인해 {@YELLOW}탑과 같은 속성의 드래곤{@DEFAULT}만 전투에 참여할 수 있습니다.\n각 속성별 탑을 정복하면 한정 드래곤을 얻을 수 있는 {@YELLOW}절대적인 전설의 알{@DEFAULT}을 얻을 수 있습니다.']='Ngan jalma anu geus ngaleuwihan wates maranéhanana di Tower Purba bisa manggihan munara misterius ieu.\nDi Tower of Tests, ngan {@YELLOW} komodo jeung atribut sarua jeung munara{@DEFAULT} bisa ngiluan perang alatan unsur kuat na. tanaga.\nLamun anjeun mupus munara unggal atribut, anjeun bisa meunangkeun {@YELLOW} Endog Legendaris Absolute {@DEFAULT} anu netas jadi naga kawates.',
['어둠의 추종자가 부활시킨 강력한 기계 드래곤 엑스 마키나가 활동하고 있는 던전입니다.\n{@YELLOW}총 10마리의 드래곤이 전투에 참가{@DEFAULT} 할 수 있으며, 엑스 마키나를 물리치면 특별한 능력을 가진 {@YELLOW}고대 룬{@DEFAULT}과 \n드래곤의 특성 레벨을 올리는 데 사용되는 {@YELLOW}아모르의 서{@DEFAULT}를 얻을 수 있습니다.']='The Ex Machina, naga mékanis kuat dibangkitkeun ku pengikut gelap, hirup di dungeon ieu. \n{@YELLOW} Nepi ka 10 komodo tiasa ngiluan perang {@DEFAULT} sareng nalika anjeun ngéléhkeun Ex Machina, anjeun tiasa nampi {@YELLOW} Rune Kuno{@DEFAULT} anu gaduh kaahlian khusus sareng\n{@YELLOW} Buku Amorru{@DEFAULT} anu digunakeun pikeun Ngawasa Level-up.',
['태초의 룬의 힘을 가졌다고 전해지는 룬 수호자가 지키는 던전입니다.\n룬 수호자 던전은 마력의 흐름이 불안정해 {@YELLOW}드래그 스킬을 사용할 수 없습니다{@DEFAULT}.\n총 6개의 던전으로 나누어진 룬 수호자 던전은, 각각의 던전마다 {@YELLOW}정해진 종류의 룬{@DEFAULT}을 얻을 수 있습니다.']='Ieu dungeon dijaga ku Rune Guardian nu katelahna boga kakuatan rune kahiji.\nDina Rune Guardians Dungeon, {@YELLOW} Drag Skill teu bisa dipake{@DEFAULT} sabab aliran sihir teu stabil.\nDiwangun ku tina 6 dungeon, anjeun bisa meunangkeun {@YELLOW} tipe husus Rune{@DEFAULT} di unggal dungeon.',
