['{@YELLOW}클랜전{@DEFAULT}은 클랜간의 경쟁 콘텐츠입니다.\n각 클랜원은 상대 클랜원을 공격해 전투를 진행하며, 전투에서 승리 시 승점을 획득합니다.\n경기가 종료 될 때, 더 많은 승점을 보유한 클랜이 경기에서 승리하게 됩니다.']='{@YELLOW} Clan War{@DEFAULT} mangrupikeun mode kompetisi clan.\nUnggal anggota klan ngalawan anggota klan lawan sareng kéngingkeun poin nalika aranjeunna meunang. \nDina tungtung pertandingan, klan anu gaduh poin langkung seueur anu meunang pertandingan.',
['시즌이 종료되면 조별리그와 토너먼트에서 달성한 순위에 따라 {@YELLOW}시즌 보상{@DEFAULT}을 얻을 수 있습니다.']='Lamun usum réngsé, pamaén meunang {@YELLOW} Season Rewards{@DEFAULT} dumasar kana rengking maranéhanana dina fase grup jeung turnamén.',
['클랜전은 2주간 진행되며 1주차 {@YELLOW}조별리그{@DEFAULT}와 2주차 {@YELLOW}토너먼트{@DEFAULT}로 구성되어 있습니다.']='Perang Klan lumangsung salila 2 minggu, diwangun ku {@YELLOW} Tahap Grup{@DEFAULT} dina minggu kahiji jeung {@YELLOW} Turnamén{@DEFAULT} dina minggu saterusna.',
['참가 조건을 만족하는 클랜은 별도의 참가 신청 없이 {@YELLOW}매 시즌 자동으로{@DEFAULT} 클랜전에 참가 됩니다.\n클랜전에 참가하기 위해서는 아래의 조건 중 하나를 만족해야 합니다.\n1. 이전 시즌 토너먼트 출전 기록이 있는 클랜\n2. 이전 시즌 콜로세움 랭킹 기록이 있으며 순위를 만족하는 클랜']='Klan nu minuhan kriteria asupna {@YELLOW} otomatis{@DEFAULT} gabung dina Perang Klan unggal usum. \nPikeun gabung dina Perang Klan, hiji klan kudu \n1. geus maén turnamén dina usum saméméhna atawa \n2. minuhan sarat ranking Colosseum dina usum saméméhna.',
['조별리그에서는 같은 조에 배정된 클랜들과 하루에 한 번 {@YELLOW}매치{@DEFAULT}를 진행합니다.\n모든 매치가 종료 된 후, 매치에서 승리한 횟수를 통해 조별 리그의 순위가 매겨집니다.\n각 조의 {@YELLOW}1,2위 클랜{@DEFAULT}은 토너먼트에 진출합니다.\n토너먼트에 진출하지 못한 클랜은 이후 일정에 참가할 수 없습니다.']='Dina Tahap Grup, klan {@YELLOW} dicocogkeun{@DEFAULT} sareng klan sanés dina grup anu sami sakali sadinten.\nSaatos pertandingan Tahap Grup réngsé, klan bakal diurutkeun dumasar kana jumlah kameunangan. \n{@YELLOW} Klan tempat ka-1 sareng ka-2 {@DEFAULT} dina unggal grup bakal ngaléngkah ka Turnamén.\nKlan anu henteu cocog henteu tiasa maén pertandingan Turnamén.',
['토너먼트는 하루에 한 번, 같은 조에 배치된 클랜과 매치를 진행합니다.\n매치에서 승리한 클랜은 다음 라운드에 진출합니다.\n패배한 클랜은 이후 일정에 참가할 수 없습니다. ']='Pertandingan turnamén dimaénkeun sakali sapoé ngalawan klan séjén dina grup nu sarua.\nKlan nu meunang pertandingan bakal maju ka babak salajengna.\nKlan nu eleh pertandingan moal maén deui pertandingan.',
['게임 시작 시 최소 10명에서 최대 20명의 클랜원이 클랜원 리스트에 등록됩니다.\n클랜원 리스트는 {@YELLOW}클랜원이 더 적은 클랜{@DEFAULT}의 인원수에 맞추어 등록됩니다.\n최소 인원을 확보하지 못한 클랜은, 부족한 인원수 만큼 상대 클랜에게 {@YELLOW}부전승 승점{@DEFAULT}을 제공합니다.']='Nalika kaulinan dimimitian, 10 ka 20 anggota klan bakal ditambahkeun kana daptar anggota clan. \nDaptar ieu dijieun kalayan jumlah anggota nu cocog jeung {@YELLOW} klan kalawan leuwih saeutik anggota{@DEFAULT}. \nKlan tanpa anggota anu cukup bakal kaleungitan {@YELLOW} poin anu tangtu{@DEFAULT} pikeun tiap anggota anu leungit, dibandingkeun sareng klan anu sanés.',
['게임이 시작되면 {@YELLOW}각 클랜원은 한 번의 공격 기회{@DEFAULT}를 가지게 됩니다.\n상대 클랜원을 공격하면 {@YELLOW}세트가 시작되며, 한 세트는 최대 3번의 {@YELLOW}게임{@DEFAULT}으로 진행됩니다.\n세트에서 먼저 2번의 게임을 승리하면 {@YELLOW}승점 1점{@DEFAULT}을 획득합니다.\n세트 시작 후, {@YELLOW}제한 시간{@DEFAULT}안에 승패가 결정되지 않으면 공격자의 패배로 처리됩니다.']='Nalika kaulinan dimimitian, {@YELLOW} unggal anggota klan bakal boga hiji kasempetan pikeun nyerang{@DEFAULT}.\nNalika anjeun nyerang anggota klan lawan, {@YELLOW} sét dimimitian, nepi ka 3 {@YELLOW} kaulinan{ @DEFAULT} pikeun tiap set. \nNu mana clan nu meunang dua kaulinan meunang {@YELLOW} 1 point{@DEFAULT}. \nUpami teu aya juara anu ditangtukeun saatos {@YELLOW} kurun waktu anu tangtu{@DEFAULT}, klan penyerang bakal éléh.',
['게임이 종료 된 후, 양 클랜 중 승점의 합이 더 높은 클랜이 승리하게 됩니다.\n만일 두 클랜의 {@YELLOW}승점이 같다면{@DEFAULT} 아래의 규칙을 순서대로 적용해 승리 클랜을 결정합니다.\n1. 세트에 참여한 클랜원 수가 더 많은 클랜의 승리\n2. 클랜원의 게임 승리 수가 더 높은 클랜의 승리\n3. 클랜 레벨(경험치)이 더 높은 클랜의 승리\n4. 클랜 생성일이 더 빠른 클랜이 승리']='Nalika patandingan réngsé, clan mana anu ngagaduhan langkung titik anu meunang pertandingan. \nUpami duanana klan gaduh {@YELLOW} poin anu sami{@DEFAULT}, aturan di handap ieu berlaku pikeun nangtukeun juara. \n1. The clan kalawan leuwih anggota gabung set meunang pertandingan. \n2. Klan kalawan leuwih win ku anggota clan meunang pertandingan. \n3. Klan kalawan tingkat luhur (EXP) meunang pertandingan. \n4. Klan anu diciptakeun saméméhna meunang pertandingan.',
['클랜원 리스트에 포함된 유저가 매치 진행중 클랜을 탈퇴할 경우, 해당 매치까지는 탈퇴한 유저의 정보가 리스트에 그대로 적용됩니다.\n매치 시작 이후 클랜에 가입한 유저는 해당 매치에 참여할 수 없습니다.\n클랜전이 진행되는 동안 클랜이 해체될 경우, 이후 예정되었던 모든 매치는 부전패 처리됩니다.']='Lamun anggota ninggalkeun clan, informasi pamaké maranéhanana bakal tetep dina daptar pikeun pertandingan. \nLamun saurang pamaén ngagabung ka clan salila pertandingan, maranéhna moal bisa ngiluan pertandingan. \nLamun hiji clan dibubarkeun salila Perang Klan, clan bakal leungit kabeh pertandingan nu bakal datang.',
['조별리그에 참여한 클랜 중 {@YELLOW}상위 32개의 클랜{@DEFAULT}은 각각 다른 조에 배치됩니다.\n이후 나머지 클랜들이 무작위로 조에 배치됩니다.\n토너먼트에 진출한 클랜 중 {@YELLOW}조별리그 1위{@DEFAULT}를 달성했던 클랜은 각각 다른 조에 배치됩니다.\n이후 나머지 클랜들이 무작위로 조에 배치됩니다.']='{@YELLOW} 32 clan pangluhurna{@DEFAULT} dina Tahap Grup bakal disimpen ka grup anu béda. \nSesa marga bakal disimpen sacara acak. \n{@YELLOW} Pamingpin unggal grup{@DEFAULT} bakal ditempatkeun dina grup anu béda nalika maju ka Turnamén. \nLajeng, klan sésana bakal disimpen sacara acak.',
