['드래곤을 등록 후 얻은 축복 티켓을 사용하여 축복을 받을 수 있습니다.\n\n축복은 5개의 타입이 있으며 원하지 않은 옵션이 나왔을때 다이아를 소모하여 옵션을 {@YELLOW}초기화{@DEFAULT}할 수 있습니다.\n- 초기화 시 해당 옵션에서 사용한 축복 티켓이 모두 반환됩니다.\n\n축복은 중첩이 가능하며 모든 드래곤,콘텐츠에서 적용이 됩니다.']='Saatos ngadaptar naga, anjeun tiasa nganggo tikét berkah pikeun nampi berkah. \n\nBlessing ngagaduhan 5 jinis, sareng nalika pilihan anu teu dihoyongkeun muncul, anjeun tiasa nganggo inten pikeun {@YELLOW} ngareset{@DEFAULT} pilihan. \n- Dina inisialisasi, sadaya tikét berkah anu dianggo dina pilihan bakal dipulangkeun. \n\nKaberkahan tiasa ditumpuk sareng tiasa dianggo pikeun sadaya naga sareng eusi.',
['전설 드래곤은 {@YELLOW}축복 티켓{@DEFAULT} 3개.\n신화 드래곤은 스킬 강화 단계에 따라 {@YELLOW}축복 티켓{@DEFAULT}이 지급 됩니다. (최대 15개 까지 획득 가능합니다.)\n\n신화 드래곤을 등록후 , 스킬 레벨업을 한뒤에 축복 시스템에 재 등록시 강화한 스킬 레벨 1당 축복 티켓 1개가 추가 지급됩니다.']='Naga Legendaris gaduh 3 {@YELLOW} tikét berkah{@DEFAULT}.\nGumantung kana tingkat paningkatan kaahlian, Mythic Dragon bakal nampi {@YELLOW} tikét berkah{@DEFAULT}.(Anjeun tiasa nampi maksimal 15 barang. ) \n\nSaatos ngadaptar Naga mitos, sakali anjeun naék tingkat kaahlian anjeun sareng ngadaptar deui dina sistem berkah, anjeun bakal nampi tikét berkah tambahan pikeun tiap tingkatan paningkatan kaahlian.',
['축복 티켓을 얻기 위해서는 {@YELLOW}육성이 완료된{@DEFAULT} 전설, 신화 드래곤을 등록해야 합니다.\n\n- 전설 드래곤 : 레벨 / 친밀도 / 강화 / 특성 / 진화 / 스킬\n- 신화 드래곤 : 레벨 / 친밀도 / 진화\n\n드래곤을 등록하여도 모든 콘텐츠에서 사용 가능합니다.\n동일한 드래곤을 여러마리 육성하여 등록하여도 , 한마리만 등록 가능합니다.']='Pikeun meunangkeun tikét berkah, anjeun kudu ngadaptar naga nu geus réngsé {@YELLOW} asuhan lengkep{@DEFAULT}. \n\n- Naga Legendaris: Level / Closeness / Ningkatkeun / Mastery / Evolve / Skill \n- Mythic Naga : Level / Closeness / Evolve \n\nSanaos anjeun ngadaptarkeun naga, éta bakal sayogi pikeun dianggo dina sadaya eusi. \nSanajan anjeun ngadaptarkeun sababaraha naga, ngan hiji anu tiasa didaptarkeun.',
['진정한 테이머가 되기 위한 길입니다.\n최대한 많은 드래곤을 육성 시켜 축복 시스템에 등록시키고, 획득한 {@YELLOW}축복 티켓{@DEFAULT}을 사용하여 {@YELLOW}축복 효과{@DEFAULT}를 받아보세요.']='Ieu jalan pikeun jadi tamer sajati.\nAjak saloba-lobana naga, daftarkeunana dina sistem berkah, tur gunakeun tiket berkah {@YELLOW}{@DEFAULT} anu kaala pikeun nampa {@YELLOW} épék berkah{@DEFAULT} .',
['드래곤을 등록 후 얻은 축복 티켓을 사용하여 축복을 받을 수 있습니다.\n\n축복은 5개의 타입이 있으며 원하지 않은 옵션이 나왔을때 다이아를 소모하여 옵션을 {@YELLOW}초기화{@DEFAULT}할 수 있습니다.\n- 초기화 시 해당 옵션에서 사용한 축복 티켓이 모두 반환됩니다.\n\n축복은 중첩이 가능하며 모든 드래곤,콘텐츠에서 적용이 됩니다.\n\n특화 옵션 15단계와 기본 옵션의 10단계의 확률은 동일하며 , 특화 옵션일수록 더 높은 수치의 옵션을 획득할 확률이 높습니다.']='Saatos ngadaptar naga, anjeun tiasa nganggo tikét berkah pikeun nampi berkah. \n\nBlessing ngagaduhan 5 jinis, sareng nalika pilihan anu teu dihoyongkeun muncul, anjeun tiasa nganggo inten pikeun {@YELLOW} ngareset{@DEFAULT} pilihan. \n- Dina inisialisasi, sadaya tikét berkah anu dianggo dina pilihan bakal dipulangkeun. \n\nKaberkahan tiasa ditumpuk sareng tiasa dianggo pikeun sadaya naga sareng eusi. \n\nKamungkinan pikeun meunangkeun pilihan khusus dina tingkat 15 sareng pilihan dasar dina tingkat 10 sami, tapi kamungkinan pikeun meunangkeun pilihan kalayan nilai anu langkung luhur langkung luhur pikeun pilihan khusus.',
